  false,\n\t\"url\": null,\n\t\"notes\": \"Estuaries are important in supporting much
  of the fishery production in the Gulf ofMexico, but this support appears to vary
  widely among different estuarine systems. The mainobjective of this project was
  to assess variability among estuaries in supporting fishery speciesand other abundant
  nekton. The project is part of a larger effort of the National Marine FisheriesService
  Galveston Laboratory to develop a Comparative Assessment of Gulf Estuarine Systems(CAGES).
  The nekton abundance data summarized in this report are available athttp://data.gcoos.org.This
  cooperative study with state natural resources agencies was designed to use fisheryindependentmonitoring
  data and compare historical catches from 4.9-m and 6.1-m trawlsurveys. This report
  provides an assessment of the abundance, length frequencies, and biomassof 14 species
  of fish and four species of decapod crustaceans that were either abundant in thesamples
  or economically important. The most abundant species in the analysis include bayanchovy,
  Atlantic croaker, spot, and brown shrimp. Other fishery species of particular interestinclude
  Gulf menhaden, white shrimp, pink shrimp, blue crab, spotted seatrout, southernflounder,
  and red drum. While the years analyzed varied among states, samples from mostestuaries
  were available and analyzed for the years 1986 to 2005. The 24 estuaries analyzedwere
  identified using the Estuarine and Coastal Drainage Areas delineated by the U. S.Geological
  Survey and listed in NOAAs Coastal Assessment Framework\",\n\t\"license_title\":
